pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

import { KyberNetworkProxy as IKyberNetworkProxy } from '@studydefi/money-legos/kyber/contracts/KyberNetworkProxy.sol';
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import './IUniswapV2Router02.sol';
import './IWeth.sol';
import "@studydefi/money-legos/onesplit/contracts/IOneSplit.sol";

contract TestArbitrage {
  IOneSplit onesplit;
  IERC20 eth;
  IERC20 dai;
  IKyberNetworkProxy kyber;
  IUniswapV2Router02 uniswap;
  address constant KYBER_ETH_ADDRESS = 0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;
  address constant daiaddress = 0x6B175474E89094C44Da98b954EedeAC495271d0F;
  address constant ethaddress = 0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;
  address constant onesplitaddress = 0xC586BeF4a0992C495Cf22e1aeEE4E446CECDee0E;
  address constant AaveLendingPoolAddressProviderAddress = 0x24a42fD28C976A61Df5D00D0599C34c4f90748c8; 

  constructor(
      address kyberAddress,
      address uniswapAddress,
      address onesplitAddress,
      address ethAddress,
      address daiAddress
  ) public {
    kyber = IKyberNetworkProxy(kyberAddress);
    uniswap = IUniswapV2Router02(uniswapAddress);
    onesplit = IOneSplit(onesplitAddress);
    dai = IERC20(daiAddress);
    eth = IERC20(ethAddress);
  }

    function _swap(address from, address to, uint256 amountWei) internal {
          IERC20 fromIERC20 = IERC20(from);
          IERC20 toIERC20 = IERC20(to);

          //Buy ETH on OneSplit
          uint256 balanceDai = dai.balanceOf(address(this));         
          dai.approve(address(onesplitaddress), balanceDai); 
          (uint256 returnAmount, uint256[] memory distribution) = IOneSplit(
              onesplitaddress
          ).getExpectedReturn(
              dai,
              eth,
              balanceDai,
              10,
              0
          );

          IOneSplit(onesplitaddress).swap(
              dai,
              eth,  
              balanceDai,
              returnAmount,
              distribution,
              0
          );

}

  function() external payable {}

}
